@Nonnull
  public static DAType wildcardWithSuperBound(@Nonnull DAType superbound) {
    return DATypeImpl.typeBuilder(DATypeKind.WILDCARD, DANameFactory.wildcard())
                 .withSuperBound(superbound)
                 .build();
  }
